import React from "react";

// set the defaults
sessionStorage.setItem('loggedIn','false')
const LoggedinContext = React.createContext({
  loggedin: sessionStorage.getItem('loggedIn'),
  setLoggedin: () => {}
});

export default LoggedinContext;
